import React, { Component } from 'react';
import Training from './Components/Training/Training';
import { Link, Switch, Route } from 'react-router-dom';
import Location from './Components/Location';
import RejectionMessage from "./Components/RejectionMessage/RejectionMessage";
import FeedbackConfiguration from "./Components/FeedBack/FeedbackConfiguration";
import UserList from './Components/User/UserList';
export default class TrainingMater extends Component {

  constructor(props) {
    super(props);
    this.state = {
      active: 'training',
    }
  }
  componentDidMount() {
    this.props.setHeader("Training Management");
  }
  setActive = (tabName) => {
    this.setState({ active: tabName })
  }
  render() {
    const { url_training, ajaxUtil, loadingFunction, setNotification } = this.props;
    const { path, url, params } = this.props.match
    return (
      <div className="container-fluid d-material">
        <div className="row m-0 syllabus-details mt-2">
          <div className="col-md-12">
            <div className="mainbg cus-pills h-100">
              <ul className="nav nav-pills align-items-end">
                <li className="nav-item">
                  <Link to={`${url}/training`} className={(this.state.active == 'training') ? "active nav-link min-width-200" : "nav-link min-width-200"}>
                    Training Type
                  </Link>
                </li>
                <li className="nav-item">
                  <Link to={`${url}/location`} className={(this.state.active == 'location') ? "active nav-link min-width-200" : "nav-link min-width-200"}>
                    Location
                  </Link>
                </li>
                <li className="nav-item">
                  <Link to={`${url}/rejection-message`} className={(this.state.active == 'rejection-message') ? "active nav-link min-width-200" : "nav-link min-width-200"}>
                    Rejection Message
                  </Link>
                </li>
                <li className="nav-item">
                  <Link to={`${url}/feedback-configuration`} className={(this.state.active == 'feedback-configuration') ? "active nav-link min-width-200" : "nav-link min-width-200"}>
                    Feedback Configuration
                  </Link>
                </li>
                <li className="nav-item">
                  <Link to={`${url}/user`} className={(this.state.active == 'user') ? "active nav-link min-width-200" : "nav-link min-width-200"}>
                    User
                  </Link>
                </li>
              </ul>
              <div className="tab-content p-0 d-material-tabcontent">
                <div className="tab-pane  show active">
                  <div className="Modules-txt h-100 ">
                    <Switch>
                      <Route exact path={path} render={(props) => (
                        <Training
                          {...props}
                          url_training={url_training}
                          ajaxUtil={ajaxUtil}
                          loadingFunction={loadingFunction}
                          setNotification={setNotification}
                          setActive={this.setActive}
                        />
                      )} />
                      <Route exact path={`${path}/training`} render={(props) => (
                        <Training
                          {...props}
                          url_training={url_training}
                          ajaxUtil={ajaxUtil}
                          loadingFunction={loadingFunction}
                          setNotification={setNotification}
                          setActive={this.setActive}
                        />
                      )} />
                      <Route path={`${path}/location`} render={(props) => (
                        <Location
                          {...props}
                          url_training={url_training}
                          ajaxUtil={ajaxUtil}
                          loadingFunction={loadingFunction}
                          setNotification={setNotification}
                          setActive={this.setActive}
                        />
                      )} />
                      <Route path={`${path}/rejection-message`} render={(props) => (
                        <RejectionMessage
                          {...props}
                          url_training={url_training}
                          ajaxUtil={ajaxUtil}
                          loadingFunction={loadingFunction}
                          setNotification={setNotification}
                          setActive={this.setActive}
                        />
                      )} />
                      <Route path={`${path}/feedback-configuration`} render={(props) => (
                        <FeedbackConfiguration
                          {...props}
                          url_training={url_training}
                          ajaxUtil={ajaxUtil}
                          loadingFunction={loadingFunction}
                          setNotification={setNotification}
                          setActive={this.setActive}
                        />
                      )} />
                      <Route path={`${path}/user`} render={(props) => (
                        <UserList
                          {...props}
                          url_training={url_training}
                          ajaxUtil={ajaxUtil}
                          loadingFunction={loadingFunction}
                          setNotification={setNotification}
                          setActive={this.setActive}
                        />
                      )} />
                    </Switch>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    )
  }

}
